	add("regent", "{\"term\":\"regent\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman {{m|fro|regent}}, Middle french (ca. 1400-1600) {{m|frm|regent}}, and their source, Latin {{m|la|regēns||ruling; ruler, governor, prince}}, present participle of {{m|la|regō||I govern, I steer}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ruler\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who rules in place of the monarch, especially because the monarch is too young, absent, or disabled\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A member of a municipal or civic body of governors, especially in certain European cities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, translating Geert Mak, \u0027Amsterdam: A Brief Life of the City\u0027, Vintage 2001, p. 139\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This perception, however, does no justice to the \u0027\u0027regents\u0027\u0027 of the city of Amsterdam\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A member of governing board of a college or university; also a governor of the Smithsonian Institute in Washington DC\", \"priority\":6}]}, \"synonyms\":{}}");

	add("reggae", "{\"term\":\"reggae\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Jamaican English {{m|en|rege||rags; a quarrel}}, originally used in the 1960s to describe a Jamaican dance. Broader musical sense popularized by the 1968 song \u0026quot;w:Do the Reggay|Do the Reggay\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of music originating in Jamaica and associated with Rastafarianism, featuring a heavy bass line, percussive rhythm guitar on the offbeat, often with close vocal harmonies\", \"priority\":1}]}, \"synonyms\":{}}");

