	add("régime", "{\"term\":\"régime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: Chris Horrocks\u0026lt;!-- illustrated by Zoran Jevtic --\u0026gt;, \u0027Introducing Foucault\u0027, pages 5\u0026lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; and 46\u0026lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; (Totem Books, Icon Books; ISBN 1840460865\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{1}\u0026lt;/sup\u0026gt; There are many “Foucaults” — whether they are all texts, or features in a network of institutional power, a \u0027\u0027régime\u0027\u0027 of truth and knowledge, or the discourse of the author and his works\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"lt;sup\u0026gt;{2}\u0026lt;/sup\u0026gt; Personalities like \u0027\u0027Sigmund Freud\u0027\u0027 (1856–1939) silenced condemnation of madness. He abolished \u0027\u0027\u0027régimes\u0027\u0027 of silence\u0027\u0027 that reformers had employed. He made the mad \u0027talk\u0027. But he also developed the structure which included the medical personage — him — as omnipotent and quasi-divine\", \"priority\":3}]}, \"synonyms\":{}}");

	add("regimen", "{\"term\":\"regimen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027regimen\u0027 (guidance”, “direction”, “government”, “rule) from \u0027regō\u0027 (i rule”, “i direct) compare \u0027regular\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Orderly government; system of order; administration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any regulation or remedy which is intended to produce beneficial effects by gradual operation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, \u0027The Edinburgh Review\u0027 (page 470\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Seven or eight annual bloodings, and as many purgations — such was the common \u0027\u0027regimen\u0027\u0027 the theory prescribed to ensure continuance of healt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"objec\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Popular Educator. A Complete Encyclopaedia of Elementary, Advanced, and Technical Education. New and Revised Edition. Volume III.\u0027, page 394 (\u0027Lessions in French.---LVIII. § 42.---Of Verbs\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"3.) Verbs admit two kinds of \u0027\u0027regimen\u0027\u0027: the \u0027direct \u0027\u0027regimen\u0027\u0027\u0027 and the \u0027indirect \u0027\u0027regimen\u0027\u0027\u0027. (4.) The \u0027direct \u0027\u0027regimen\u0027\u0027\u0027, or immediate object [...] (5.) The \u0027indirect \u0027\u0027regimen\u0027\u0027\u0027, or remote object\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1828\u0027\u0027, J. V. Douville, \u0027The Speaking French Grammar, forming a series of sixty explanatory lessons, with colloquial essays\u0027, third edition, London, page 84 and 315\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Active verbs\u0027 express an action which an agent, called the nominative or subject, performs on an object or \u0027\u0027regimen\u0027\u0027, without the help of a preposition: as,--- Pierre aime Sophie, Peter loves Sophia. [...] Of the Object or \u0027\u0027Regimen\u0027\u0027 of Verbs\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1831\u0027\u0027 and \u0027\u00271854\u0027\u0027, A. Bolmar, \u0027A Book of the French Verbs, Wherein the Model Verbs, and Several of the Most Difficult Are Conjugated Affirmatively, Negatively, Interrogatively, an Negatively and Interrogatively.\u0027 and \u0027A Book of the French Verbs, Wherein the Model Verbs, and Several of the Most Difficult Are Conjugated Affirmatively, Negatively, Interrogatively, an Negatively and Interrogatively. A New Edition\u0027, Philadelphia, page 2\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"15. A verb is \u0027active\u0027 in French when it expresses that an agent called nominative, or subject, performs an action on an object, or \u0027\u0027regimen\u0027\u0027, without the help of a preposition---as, \u0027Jean frappe Joseph\u0027, John strikes Joseph, \u0026amp;c\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, M. Josse, \u0027A Grammar of the Spanish Language with Practical Exercises. First Part\u0027, page 51\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Pronouns may be \u0027nominatives\u0027, and of the \u0027direct\u0027 or \u0027indirect \u0027\u0027regimen\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A syntactical relation between words, as when one depends on another and is regulated by it in respect to case or mood; government\", \"priority\":14}]}, \"synonyms\":{}}");

	add("regiment", "{\"term\":\"regiment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027regement\u0027 \u0027\u0027 and its source, \u0027regimentum\u0027 () from Latin \u0027rego\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A unit of armed troops under the command of an officer, and consisting of several smaller units; now specifically, usually composed of two or more battalions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, \u0027Kim\u0027, III\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was an old, withered man, who had served the Government in the days of the Mutiny as a native officer in a newly raised cavalry \u0027\u0027regiment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Nicholas Watt \u0026amp; Michael White, \u0027The Guardian\u0027, 28 April 2005\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As the prime minister insisted that he had \u0026quot;never told a lie\u0026quot; in his life, the Tory leader attacked him for ordering Scottish troops into battle with no warning that their \u0027\u0027regiments\u0027\u0027 would be disbanded\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Rule or governance over a person, place etc.; government, authority\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1576\u0027\u0027, translating Cicero, \u0027A Panoplie of Epistles\u0027, XXXIII\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"What place is there in all the world, not subiect to the \u0027\u0027regiment\u0027\u0027 and power of this citie\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.8\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Then loyall love had royall \u0027\u0027regiment\u0027\u0027, / And each unto his lust did make a lawe, / From all forbidden things his liking to withdraw\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, \u0027The Province of Jurisprudence Determined\u0027, VI\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"And how is it possible to distinguish precisely […] the powers of ecclesiastical \u0027\u0027regiment\u0027\u0027 which none but the church should wield from the powers of ecclesiastical \u0027\u0027regiment\u0027\u0027 (on the \u0027jus circa sacra\u0027) which secular and profane governments may handle without sin\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The state or office of a ruler; rulership\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Influence or control exercised by someone or something (especially a planet\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A place under a particular rule; a kingdom or domain\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A regimen\", \"priority\":16}]}, \"synonyms\":{}}");

	add("regimina", "{\"term\":\"regimina\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027regimina\u0027 nominative plural form of \u0027regimen\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027: George Sarton, \u0027Introduction to the History of Science\u0027, volume 2, part 1, [http://books.google.co.uk/books?id\u003dQeMMAAAAIAAJ\u0026amp;q\u003dregimina\u0026amp;dq\u003dregimina\u0026amp;lr\u003d\u0026amp;ei\u003dOSmCSof3BZ7CzQTAl-nDCg page 88] (the Williams \u0026amp; Wilkins Company\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Let us consider a few examples of \u0027\u0027regimina\u0027\u0027 and similar works in various literatures. The earliest to draw our attention in this period are the Greek\", \"priority\":2}]}, \"synonyms\":{}}");

	add("regina", "{\"term\":\"regina\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027regina\u0027 (queen) The given name originally referred to the Virgin Mary as the Queen of Heaven. The Canadian city was named for Queen Victoria.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The reigning queen\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The provincial capital of Saskatchewan (Canada) with a metropolitan population of about 200,000\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 , \u0027Hotel Paradise\u0027, Headline, ISBN 0-7472-1538-3, page 5\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Of course, her name isn\u0027t really \u0027Ree-Jane\u0027; it\u0027s \u0027\u0027Regina\u0027\u0027 Jane Davidow. I have always thought the name itself rather wonderful and am only sorry it belongs to her\", \"priority\":4}]}, \"synonyms\":{}}");

	add("region", "{\"term\":\"region\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027regiun\u0027, from Latin \u0027regio, regionem\u0027, from \u0027regere\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any considerable and connected part of a space or surface; specifically, a tract of land or sea of considerable but indefinite extent; a country; a district; in a broad sense, a place without special reference to location or extent but viewed as an entity for geographical, social or cultural reasons\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the equatorial \u0027\u0027regions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the temperate \u0027\u0027regions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the polar \u0027\u0027regions\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the upper \u0027\u0027regions\u0027\u0027 of the atmosphere\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An administrative subdivision of a city, a territory, a country or the European Union\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Such a division of the city of Rome and of the territory about Rome, of which the number varied at different times; a district, quarter, or ward\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The inhabitants of a region or district of a country\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A place in or a part of the body in any way indicated\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"the abdominal \u0027\u0027regions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Place; rank; station; dignity\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The space from the earth\u0027s surface out to the orbit of the moon: properly called the elemental region\", \"priority\":12}]}, \"synonyms\":{}}");

	add("regionalism", "{\"term\":\"regionalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|regional|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Affection, often excessive, to one\u0027s own region and to everything related to it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Political tendency to concede forms of politico-administrative autonomy to regions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A word or phrase originating in, characteristic of, or limited to a region\", \"priority\":3}]}, \"synonyms\":{}}");

