	add("regions", "{\"term\":\"regions\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the rest of the country excluding the capital city or metropolitan regio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Emer Hughes, \u0027[http://www.thepost.ie/archives/2000/1112/fair-city-losing-out-to-the-regions-901357038.html Fair city losing out to the regions]\u0027, \u0027Sunday Business Post\u0027 7 November\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Tom Clancy of Elan Recruitment thinks that staff shortages in \u0027\u0027the regions\u0027\u0027 could be as severe as in Dublin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Peter Hetherington, \u0027[http://www.guardian.co.uk/politics/2003/sep/10/uk.Whitehall Study points civil servants towards the regions]\u0027, \u0027The Guardian\u0027, 10 September\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Three government departments may be named for a move from London to \u0027\u0027the regions\", \"priority\":5}]}, \"synonyms\":{}}");

	add("register", "{\"term\":\"register\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From {{m|la|registrum}}, from {{m|la|regesta||list, items recorded}}, from Latin {{m|la|regero|regerere|to record, to carry back}}, from {{m|la|re-}} + {{m|la|gerere||to carry, bear}}. Compare Latin {{m|la|registoria||a treasurer}}. Some senses influenced by association with Latin {{m|la|regere||to rule}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formal recording of names, events, transactions etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The teacher took the \u0027\u0027register\u0027\u0027 by calling out each child\u0027s name\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A book of such entries\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As you have one eye upon my follies, turn another into the \u0027\u0027register\u0027\u0027 of your own\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An entry in such a book\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of registering\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A certificate issued by the collector of customs of a port or district to the owner of a vessel, containing the description of a vessel, its name, ownership, and other material facts. It is kept on board the vessel, to be used as evidence of nationality or as a muniment of title\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One who registers or records; a registrar; especially, a public officer charged with the duty of recording certain transactions or events\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027register\u0027\u0027 of deeds\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A device that automatically records a quantity\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The part of a telegraphic apparatus that automatically records the message received\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A list of received calls in a phone set\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A small unit of very fast memory that is directly accessible to the central processing unit, and is mostly used to store inputs, outputs or intermediate results of computations\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Michael A. Miller, \u0027The 68000 Microprocessor Family: Architecture, Programming, and Applications\u0027 (page 47\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"When the microprocessor decodes the JSR opcode, it stores the operand into the TEMP \u0027\u0027register\u0027\u0027 and pushes the current contents of the PC ($00 0128) onto the stack\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The exact alignment of lines, margins and colors\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The inner part of the mould in which types are cast\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The range of a voice or instrument\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"An organ stop\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A style of a language used in a particular contex\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"My ex-boss used \u0026quot;let go\u0026quot;, in the euphemistic \u0027\u0027register\u0027\u0027, when he sacked me\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"It seems equally clear that the ‘Complement + Prepositionʼ order illustrated in (172) (a) is likewise highly marked, and hence subject to heavy restrictions on its use. And sure enough, this does indeed seem to be the case: for one thing, forms such as \u0027thereafter\u0027, \u0027herein\u0027, \u0027whereby\u0027 are stylistically highly marked (e.g. they are only used in particular \u0027\u0027registers\u0027\u0027 such as legal language\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"A grille at the outflow of a ventilation duct\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"short form for cash register\", \"priority\":25}]}, \"synonyms\":{}}");

