	add("regolith", "{\"term\":\"regolith\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Irregular formation from Ancient greek (to 1453) \u0027ῥῆγος\u0027 (rug, blanket) + \u0027\u0027 (from \u0027λίθος\u0027 (stone) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The layer of loose rock, dust, sand, and soil, resting on the bedrock, that constitutes the surface layer of most dry land on earth, the moon, and other large solid aggregated celestial objects. There can also be sub-marine regolith\", \"priority\":1}]}, \"synonyms\":{}}");

