	add("regress", "{\"term\":\"regress\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"(verb) From Latin \u0027lang\u003dla\u0027 past participle of \u0027lang\u003dla|regredi\u0027 () from \u0027lang\u003dla|re-\u0027 () + \u0027lang\u003dla|gradi\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of passing back; passage back; return; retrogression\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Frederic Harriso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Its bearing on the progress or \u0027\u0027regress\u0027\u0027 of man is not an inconsiderable question\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The power or liberty of passing back\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thou shalt have egress and regress\", \"priority\":6}]}, \"synonyms\":{}}");

