	add("regression", "{\"term\":\"regression\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|regress|ion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An action of regressing, a return to a previous state\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1899:\u0027\u0027 Thorstein Veblen, \u0027The Theory of the Leisure Class\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Few of these groups or communities that are classed as \u0026quot;savage\u0026quot; show no traces of \u0027\u0027regression\u0027\u0027 from a more advanced cultural stage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A psychotherapeutic method whereby healing is facilitated by inducing the patient to act out behaviour typical of an earlier developmental stage\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An analytic method to measure the association of one or more independent variables with a dependent variable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An equation using specified and associated data for two or more variables such that one variable can be estimated from the remaining variable(s\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The reappearance of a bug in a piece of software that had previously been fixed\", \"priority\":7}]}, \"synonyms\":{}}");

