	add("regularity", "{\"term\":\"regularity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027regularite\u0027 from *\u0027\u0027 () from Latin \u0027regularis\u0027 (regular) see regular.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition or quality of being regular; as, regularity of outlin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I have been watching that show with \u0027\u0027regularity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A particular regular occurrence\", \"priority\":3}]}, \"synonyms\":{}}");

	add("regulator", "{\"term\":\"regulator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device that controls or limits something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The voltage \u0027\u0027regulator\u0027\u0027 stopped working and the resulting overload destroyed the device\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person or group that sets standards of practice, especially those established by law\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A very accurate clock, used by clockmakers to measure the timekeeping of each newly made clock\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Genetics) A gene involved in controlling the expression of one or more other genes\", \"priority\":5}]}, \"synonyms\":{}}");

